function compareIPIXfigure(Y1, figHandle)
%CREATEFIGURE(Y1)
%  Y1:  vector of y data
%Y1 = trainError(1,[1 3 5 7 9]).^2;
%  Auto-generated by MATLAB on 14-Feb-2017 17:04:24

% Create figure
figure(figHandle);
clf(figHandle);
% Create axes
axes1 = axes('Parent',figHandle,'YGrid','on','YScale','log');
box(axes1,'on');
hold(axes1,'on');

% Create semilogy
hold on;
semilogy([1 5],[0.00115 0.0301],'DisplayName','Rodan & Tino. 2010.','Marker','diamond','LineStyle','none');
semilogy(1:10,[0.0015 0.003 0.006 0.0115 0.017 0.025 0.035 0.049 0.062 0.08 ],'DisplayName','Duport et al. 2012','Marker','diamond','LineStyle','none');
semilogy(1:10,[0.0045 0.012 0.025 0.05 0.075 0.12 0.18 0.22 0.29 0.36],'DisplayName','Duport et al. 2016','Marker','diamond','LineStyle','none');

for i = 1:size(Y1,1)
    semilogy(Y1(i,21:30),'DisplayName',strcat('Material_',num2str(i)),'Marker','diamond','LineStyle','none');
end
hold off;

% Create legend
%legend(axes1,'Rodan & Tino. 2010.','Duport et al. 2012','Duport et al. 2016','Avg best reser')
legend(axes1,'show');